Before we can invoke functions, we first initialize and start a client. Starting the client for the first time will take a little amount of time regardless of the connection speed. It might even take more if you are connecting to a test server. In this guide, our client will always take a little to start since we don’t have a persistency layer for the sake of staying simple. Extend the contents of the <script> tag with this snippet: const client = new Client(); console.log("Starting client...");
await client.connect();
console.log("Client started."); The above code initializes a client with the default parameters and no API credentials. After that, it initiates a connection with Telegram’s test servers.

